import React, { useState } from "react";
import { Link } from "react-router-dom";
// import imageFile from '/public/engagement_1';

const menuItems = [
 { label: "Home", path: "/" },
 { label: "Story", path: "/story" },
 { label: "Agenda", path: "/detail" },
 { label: "Infomration", path: "/info" },
 // { label: 'RSVP', path: '/rsvp' },
 // { label: 'Contact Us', path: '/contact' },
];

function Test() {
 return (
  <div>
   <div class="container">
    <div class="nav-scroller py-1 mb-3 border-bottom">
     <nav class="nav nav-underline justify-content-between">

            {menuItems.map((item, index) => (
                <Link className="nav-item nav-link link-body-emphasis nav-link" key={index} to={item.path}>
                  {item.label}
                </Link>
            ))}


     </nav>
    </div>
    <header class=" lh-1 py-3">
     <div class="row flex-nowrap justify-content-between align-items-center">
      <div class="col-4 pt-1"></div>
      <div class="col-4 text-center">
       <a
        class="blog-header-logo text-body-emphasis text-decoration-none"
        href="#"
       >
        Chloe & Charles Wedding 
       </a>
      </div>
      <div class="col-4 d-flex justify-content-end align-items-center">
       <a class="btn btn-sm btn-outline-secondary" href="#">
        RSVP
       </a>
      </div>
     </div>
    </header>
   </div>

  </div>
 );
}

export default Test;
